// Dashboard.js
import React, { useState, useEffect, useRef } from 'react';
import Appbar from '../surface/Appbar';
import uccplogo from '../assets/uccplogo.png';
import schlogo from '../assets/schlogo.png';

function Home() {
  const [currentImage, setCurrentImage] = useState(0);
  const imageSources = [schlogo, uccplogo];

  useEffect(() => {
    const intervalId = setInterval(() => {
      setCurrentImage((prevImage) => (prevImage + 1) % imageSources.length);
    }, 3000);

    return () => clearInterval(intervalId);
  }, [imageSources.length]);

  const imageStyles = {
    image1: { height: '30rem', width: '30rem' },
    image2: { height: '30rem', width: '30rem' },
  };

  const currentImageStyle = imageStyles[`image${currentImage + 1}`];

  return (
    <section className='h-screen flex flex-col justify-center items-center bg-white'>
      <div className='flex-1 flex flex-col items-center justify-center md:items-center md:justify-center'>
        <img
          src={imageSources[currentImage]}
          alt=""
          style={currentImageStyle}
        />
      </div>
      <div className='flex-1 px-4 flex flex-col text-center justify-center mt-0 mx-2 lg:text-start lg:justify-center'>
        <p className='text-2xl sm:text-2xl md:text-3xl font-bold mb-2'>Welcome to</p>
        <h1 className='text-2xl sm:text-3xl md:text-6xl font-bold mb-2' style={{ color: '#079440' }}>
          Cagayan de Oro Christian School - UCCP <span style={{ color: '#F2B569' }}>E-Portal</span>
        </h1>
        <p className='text-2xl sm:text-2xl md:text-2xl font-semibold mb-2 italic'>
          "Give your child an education that is nurtured by Christ-centered ideals."
        </p>
      </div>
    </section>
  );
}

function AboutUs() {
  return (
    <section className='h-screen flex flex-col justify-center items-center bg-gray-200'>
      <div className='flex-1 px-4 flex flex-col text-center justify-center mt-0 mx-2'>
        <h2 className='text-3xl font-bold mb-4'>About Us</h2>
        <p className='text-lg'>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed hendrerit luctus lacus, ac ullamcorper orci ultrices id.
          Nunc in odio eu dui luctus bibendum ac nec justo. In hac habitasse platea dictumst.
        </p>
      </div>
    </section>
  );
}

function Contact() {
  return (
    <section className='h-screen flex flex-col justify-center items-center bg-blue-200'>
      <div className='flex-1 px-4 flex flex-col text-center justify-center mt-0 mx-2'>
        <h2 className='text-3xl font-bold mb-4'>Contact</h2>
        <p className='text-lg'>
          If you have any questions or need further information, please feel free to contact us.
        </p>
        <p className='text-lg'>
          Email: info@example.com <br />
          Phone: (123) 456-7890
        </p>
      </div>
    </section>
  );
}

function Dashboard() {
  const aboutRef = useRef(null);
  const contactRef = useRef(null);

  const handleScrollTo = (ref) => {
    if (ref) {
      ref.current.scrollIntoView({ behavior: 'smooth' });
    } else {
      window.scrollTo({ top: 0, behavior: 'smooth' });
    }
  };

  return (
    <div className='flex flex-col h-screen'>
      <Appbar
        handleScrollToHome={() => handleScrollTo(null)}
        handleScrollToAbout={() => handleScrollTo(aboutRef)}
        handleScrollToContact={() => handleScrollTo(contactRef)}
      />
      <Home />
      <AboutUs ref={aboutRef} />
      <Contact ref={contactRef} />
    </div>
  );
}

export default Dashboard;
